import React from "react";
import periodicTables from "./periodicTables.png";
import weLoveMovies from "./weLoveMovies.png";

function Projects() {
  return (
    <div className="breathe">
      <h2 id="projects">My Babies</h2>
      <div className="row">
        <div className="column2">
          <div className="card2">
            <div className="polaroid">
              <img
                  className="imageClass"
                src={periodicTables}
                //   style={{ marginBottom: "20px" }}
              />
              <div className="container">
                <p>GitHub Repo</p>
              </div>
            </div>
          </div>
        </div>
        <div className="column2">
          <div className="card2">
            <h4>WeLoveMovies</h4>
            <img
              className="imageClass"
              src={weLoveMovies}
              style={{ marginBottom: "20px" }}
            />
            <p>Find Your Favorite Movie</p>
            <p>Node, Express, Knex, PostgreSQL, HTTP </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Projects;

